import React, { Component } from 'react';
import './App.css';
import axios from 'axios'

class App extends Component {
    constructor (props){
        super(props)
        axios.post(`http://127.0.0.1:8000/check/`,
            {
                name: 'Deepraj'
            }
        )
        .then(res => res.json())
        .then(json => {
            console.log(json)
        });
    }
    render() {
        return (
            <div className="App">

            </div>
        );      
    }

}

export default App;
